import { Card } from 'antd';
import {Component} from 'react'
const { Meta } = Card;

class CardComponent extends Component {
    
    render() {
        return ( 
            <Card
                hoverable
                style={{ width: 240 }}
                cover={<img alt="example" src={this.props.imagesrc} />}
            >
                <Meta title={this.props.title} description={this.props.price} />
            </Card>

        );
        }
    }

    export default CardComponent;
